class Solution {
private:
    int findFirstEqual(string &s, int begin, vector<string>& words) {
        if (words.size() == 0) {
            return -1;
        } else if (words.size() == 1) {
            return 0;
        }
        int h = 0, l = words.size() - 1;
        while (l-h > 1) {
            int mid = (h+l)/2;
            int cmp = s.compare(begin, words[mid].size(), words[mid]);
            if (cmp > 0) {
                h = mid;
            } else {
                l = mid;
            }
        }
        return h;
    }
    bool checkIfError(string &s, int begin, int end, vector<string>& words, vector<int> &wordtag) {
        if(begin == end) {
            return true;
        }
        for(int i = findFirstEqual(s, begin, words); i != -1 && i < words.size(); i++) {
            int cmp = s.compare(begin, words[i].size(), words[i]);
            if (cmp < 0) {
                break;
            } else if (cmp > 0) {
                continue;
            } else if (wordtag[i] > 0) {
                wordtag[i]--;
                if(checkIfError(s, begin+words[i].size(), end, words, wordtag)) {
                    wordtag[i]++;
                    return true;
                }
                wordtag[i]++;
            }
        }
        // for(int i = 0; i < words.size(); i++) {
        //     if(wordtag[i] > 0 && s.compare(begin, words[i].size(), words[i]) == 0) {
        //         wordtag[i]--;
        //         if(checkIfError(s, begin+words[i].size(), end, words, wordtag)) {
        //             wordtag[i]++;
        //             return true;
        //         }
        //         wordtag[i]++;
        //     }
        // }
        return false;
    }
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        int subLen = 0;
        for(auto &word : words) {
            subLen += word.size();
        }
        sort(words.begin(), words.end());
        vector<string> newWords;
        vector<int> wordNum;
        for(int i = 0; i < words.size(); i++) {
            if (newWords.size() != 0 && words[i] == newWords[newWords.size()-1]) {
                wordNum[newWords.size()-1]++;
            } else {
                newWords.emplace_back(words[i]);
                wordNum.emplace_back(1);
            }
        }

        vector<bool> stag(s.size());
        for(int i = 0; i < newWords.size(); i++) {
            vector<int> wordtag(wordNum);
            wordtag[i]--;
            for(int j = s.find(newWords[i]); j <= (int)s.size()-subLen && j != -1; j = s.find(newWords[i], j+1))
                if(stag[j] != true && checkIfError(s, j+newWords[i].size(), j+subLen, newWords, wordtag))
                    stag[j] = true;
        }
        vector<int> rlt;
        for(int i = 0; i < stag.size(); i++) {
            if(stag[i])
                rlt.emplace_back(i);
        }
        return rlt;
    }
};

